  <React.StrictMode>
    {/* 3. Wrap everything in the Router */}
    <Router>
      {/* 4. Wrap everything in the AuthProvider */}
      <AuthProvider> 
        <App />
      </AuthProvider>
    </Router>
  </React.StrictMode>
);

